import React,{memo} from 'react';
import {Link,Routes,Route} from 'react-router-dom';
const App = memo(() => {
  return (
    <div>
      <h1>13-redux</h1>
      <nav>
        <MenuLink to='/counter'>Counter</MenuLink>
      </nav>
      <Routes>
        <Route path='/counter' element={<Counter />} />
      </Routes>
    </div>
  );
});

export default App;
